import AdminPage from './component/adminpage'
import './App.css';
import { Route } from 'react-router-dom';
import EditCoinInfo from './component/editCoin';

function App() {


  return (
    <div className="App">
     <AdminPage />
     <Route path="/updateCoin" element={<EditCoinInfo />}>
     </Route>
    </div>
  );
}

export default App;
